const pageSectionsAPI = {
    // すべてのページセクションを取得
    async getAllSections () {
        const { data, error } = await supabase.from('page_sections').select(`
        *,
        article:articles(*)
      `).order('section_name').order('position');
        if (error) throw error;
        return data;
    },
    // 特定のセクションのデータを取得
    async getSectionByName (sectionName) {
        const { data, error } = await supabase.from('page_sections').select(`
        *,
        article:articles(*)
      `).eq('section_name', sectionName).order('position');
        if (error) throw error;
        return data;
    },
    // ページセクションを更新
    async updateSection (id, articleId) {
        const { error } = await supabase.from('page_sections').update({
            article_id: articleId
        }).eq('id', id);
        if (error) throw error;
    },
    // 複数のページセクションを一括更新
    async updateMultipleSections (updates) {
        const promises = updates.map((update)=>supabase.from('page_sections').update({
                article_id: update.article_id
            }).eq('id', update.id));
        const results = await Promise.all(promises);
        const errors = results.filter((result)=>result.error).map((result)=>result.error);
        if (errors.length > 0) throw errors[0];
    },
    // セクションに新しいカードを追加
    async addCardToSection (sectionName) {
        // 現在のセクションの最大位置を取得
        const { data: maxPositionData, error: maxError } = await supabase.from('page_sections').select('position').eq('section_name', sectionName).order('position', {
            ascending: false
        }).limit(1);
        if (maxError) throw maxError;
        const nextPosition = maxPositionData.length > 0 ? maxPositionData[0].position + 1 : 1;
        // 新しいカードを追加
        const { data, error } = await supabase.from('page_sections').insert({
            section_name: sectionName,
            position: nextPosition,
            article_id: null
        }).select().single();
        if (error) throw error;
        return data;
    },
    // セクションからカードを削除（最後のカードを削除）
    async removeCardFromSection (sectionName) {
        // 現在のセクションの最大位置のカードを取得
        const { data: maxPositionData, error: maxError } = await supabase.from('page_sections').select('*').eq('section_name', sectionName).order('position', {
            ascending: false
        }).limit(1);
        if (maxError) throw maxError;
        if (maxPositionData.length === 0) {
            throw new Error('削除するカードがありません');
        }
        // 最後のカードを削除
        const { error } = await supabase.from('page_sections').delete().eq('id', maxPositionData[0].id);
        if (error) throw error;
        return maxPositionData[0];
    },
    // 特定のカードを削除
    async removeSpecificCard (cardId) {
        const { error } = await supabase.from('page_sections').delete().eq('id', cardId);
        if (error) throw error;
    },
    // セクションを初期化（存在しない場合のみ作成）
    async initializeSection (sectionName, positions) {
        // セクションが既に存在するかチェック
        const { data: existingData, error: existingError } = await supabase.from('page_sections').select('id').eq('section_name', sectionName).limit(1);
        if (existingError) throw existingError;
        // 既に存在する場合は何もしない
        if (existingData && existingData.length > 0) {
            return;
        }
        // 存在しない場合は初期レコードを作成
        const insertData = positions.map((position)=>({
                section_name: sectionName,
                position: position,
                article_id: null
            }));
        const { error } = await supabase.from('page_sections').insert(insertData);
        if (error) throw error;
    }
};
